import logo1 from '../media/logo1.png'

function Logo1(){
    return (
        <a href="/"onClick={e=>e.preventDefault()}>
            <img src={logo1} alt="" 
                srcset="" className="rounded mx-auto d-block w-25 vh-75" 
                />
        </a>
    )
}

export default Logo1;
